import { USER_LIST, VALIDATE_USER } from "./constants";

export const GetList = (data) => {
    return (dispatch) => {
        dispatch({
            type: USER_LIST,
            payload: data
        })
    }
}

export const ValidateUser = (data) => {
    return (dispatch) => {
        dispatch({
            type: VALIDATE_USER,
            payload: data
        })
    }
}
